import React, { Component } from 'react'
import style from './Fourth.module.css'
import pic from './ad.png'
class Fourth extends Component {
  render() {
    return (
      <div id={style.fourth}>
        <div id={style.fourthLeft}>
            <div id={style.divDeal}></div>
            <div id={style.deals}>
                <div><img src="https://rukminim1.flixcart.com/image/150/150/kyag87k0/computer/7/r/u/raider-ge66-12ugs-gaming-laptop-msi-original-imagakb9zw7gqzcm.jpeg?q=70"></img></div>
            </div>
        </div>
        <div id={style.fourthRight}><img src={pic}></img></div>
      </div>
    )
  }
}

export default Fourth
